const storeList = {
    pageAtion: [],
    pageEditid: [],
    user: {}
}

const Reducer = (state = storeList, action) => {
    switch (action.type) {
        case 'userLogin':
            return Object.assign({}, state, {
                user: state.user = action.data,
            })
            break
        default:
            return state
    }
}

export default Reducer
